import Introduction from "./Introduction";
import Portfolio from "./Portfolio";
import About from "./About";
import Contact from "./Contact";
import Footer from "./Footer";

const Main = () => {
  return (
    <>
      <Router>
        <div>
          <Introduction />
          <Portfolio />
          <About />
          <Contact />
          <Footer />
        </div>
      </Router>
    </>
  );
};

export default Main;
